// SPDX-License-Identifier: MIT
pragma solidity ^0.8.15;


//固定长度的数组，不能使用会修改数组长度的方法，如：push、pop
contract ArrayTest {
    struct User {
        string name;
        uint age;
    }

    function f1() public pure {
        uint[] memory arr = new uint[](5);
        // arr.push(5);
        // arr.pop();
        arr[0] = 1;
        arr[1] = 2;
        arr[2] = 3;
        arr[3] = 4;
        arr[4] = 5;

        delete arr[4];
    }
    


}
